var IntersectionObserver = typeof global.IntersectionObserver !== 'undefined';

var prefetch = 'document' in global && function () {
  var $el = document.createElement('link');

  try {
    return $el.relList.supports('prefetch');
  } catch (err) {
    return false;
  }
}();

export default {
  IntersectionObserver: IntersectionObserver,
  prefetch: prefetch
};
